<!doctype>
<html>
    <head>
        <meta name="title" content="template"  />
        <meta name="alias" content=""  />

        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <link href="css/bootstrap.min.css" rel="stylesheet" media="screen">
        <link href="css/global.css" rel="stylesheet" media="screen">
        <link href="css/github-theme.css" rel="stylesheet" media="screen">

    <body>
        <article></article>
        <script data-step="1" data-label="Using Print">
            var step1 = function() {
                //---
                var
                    authors = [
                        { name: "Craig", state: "CA" },
                        { name: "Dan", state: "AZ" },
                        { name: "Elijah", state: "TN" },
                        { name: "John", state: "FL" }
                    ],

                    data = {
                        authors: authors
                    },

                    list = '<ul>' +
                    '<% _.each(authors, function(author) { %>' +
                        '<li>' +
                        '<% print(author.name + " is a stalwart gentleman!"); %>' +
                        '</li>' +
                    '<% }); %></ul>',

                    applyTemplate = _.template(list),

                    result = applyTemplate(data);

                logRaw(result);
                //---
            }
        </script>
        <script data-step="2" data-label="Change Template Demlimiters">
            var step2 = function() {
                //---
                _.templateSettings = {
                    interpolate: /<da-codez>(.+?)<\/da-codez>/g
                };

                var
                    author = { name: 'Craig' },

                    compiled = _.template(
                        '<da-codez>name</da-codez> says, "hi there!"'),

                    result = compiled(author);


                log(result);
                //---
            }
        </script>
        <script data-step="3" data-label="Changing Scope">
            var step3 = function() {
                //---
                var
                    templateLocalScope = '<ol>' +
                    '<% _.each(people, function(person) { %>' +
                        '<li><%= person.firstName %></li>' +
                    '<% }); %></ol>',

                    templateVariableScope = '<ol>' +
                    '<% _.each(data.people, function(person) { %>' +
                        '<li><%= person.firstName %></li>' +
                    '<% }); %></ol>',

                    vm = $.mockJSON.generateFromTemplate({
                        "people|5000-5000": [{
                            "id|+1": 1,
                            "firstName": "@MALE_FIRST_NAME",
                            "lastName": "@LAST_NAME"
                        }]
                    }),

                    settings = { variable: 'data' },

                    result;

                console.time('local-scope');
                result = _.template(templateLocalScope, vm);
                console.timeEnd('local-scope');

                console.time('variable-scope');
                result = _.template(templateVariableScope, vm, settings);
                console.timeEnd('variable-scope');

                logRaw(result);
                //---
            }
        </script>
